import React, { Component } from "react";

const Overview = (props) => {
    const { tasks } = props;
    // const tasks = [{text: "1"}, {text: "2"}];
    return (
        <div>
            <ul>
                {tasks.map((task) => {
                    return (
                        <p>{task.text}</p>
                        );
                    }
                )}
            </ul>
        </div>
    );
}

export default Overview;
